import React, { useState } from "react";
import { crearDirector } from "../../services/administradorService";

function CrearDirector() {
    const [rut, setRut] = useState("");
    const [nombre, setNombre] = useState("");
    const [apellido, setApellido] = useState("");
    const [direccion, setDireccion] = useState("");
    const [telefono, setTelefono] = useState("");
    const [correo, setCorreo] = useState("");
    const [fechaNacimiento, setFechaNacimiento] = useState("");
    const [password, setPassword] = useState("");

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            await crearDirector({
                rut,
                nombre,
                apellido,
                direccion,
                telefono,
                correo,
                fecha_nacimiento: fechaNacimiento,
                password,
                rol: "DIRECTOR",
            });
            setRut("");
            setNombre("");
            setApellido("");
            setDireccion("");
            setTelefono("");
            setCorreo("");
            setFechaNacimiento("");
            setPassword("");
            alert("Director creado con éxito");
        } catch (error) {
            console.error("Error al crear el director:", error);
        }
    };

    return (
        <form onSubmit={handleSubmit}>
            <div>
                <label htmlFor="rut">Rut:</label>
                <input
                    type="text"
                    id="rut"
                    value={rut}
                    onChange={(e) => setRut(e.target.value)}
                />
            </div>
            <div>
                <label htmlFor="nombre">Nombre:</label>
                <input
                    type="text"
                    id="nombre"
                    value={nombre}
                    onChange={(e) => setNombre(e.target.value)}
                />
            </div>
            <div>
                <label htmlFor="apellido">Apellido:</label>
                <input
                    type="text"
                    id="apellido"
                    value={apellido}
                    onChange={(e) => setApellido(e.target.value)}
                />
            </div>
            <div>
                <label htmlFor="direccion">Dirección:</label>
                <input
                    type="text"
                    id="direccion"
                    value={direccion}
                    onChange={(e) => setDireccion(e.target.value)}
                />
            </div>
            <div>
                <label htmlFor="telefono">Teléfono:</label>
                <input
                    type="text"
                    id="telefono"
                    value={telefono}
                    onChange={(e) => setTelefono(e.target.value)}
                />
            </div>
            <div>
                <label htmlFor="correo">Correo:</label>
                <input
                    type="email"
                    id="correo"
                    value={correo}
                    onChange={(e) => setCorreo(e.target.value)}
                />
            </div>
            <div>
                <label htmlFor="fechaNacimiento">Fecha de nacimiento:</label>
                <input
                    type="date"
                    id="fechaNacimiento"
                    value={fechaNacimiento}
                    onChange={(e) => setFechaNacimiento(e.target.value)}
                />
            </div>
            <div>
                <label htmlFor="password">Contraseña:</label>
                <input
                    type="password"
                    id="password"
                    value={password}
                    onChange={(e) => setPassword(e.target.value)}
                />
            </div>
            <button type="submit">Crear director</button>
        </form>
    );
}

export default CrearDirector;
